import './App.css';
import { BrowserRouter, Route, Routes } from "react-router-dom";
import Login from './components/Login/Login';
function App() {
  return (
    <BrowserRouter>
    <Routes>
      <Route path='/' element={<Login/>} />
      <Route 
      path='/login'
      render={props => <Auth {...props} authRoute='login'></Auth>}
      ></Route>
      <Route 
      path='/'
      render={props => <Auth {...props} authRoute='login'></Auth>}
      ></Route>
    </Routes>
    </BrowserRouter>
  );
}

export default App;
